description:
BBC Easy Cook Magazine is the UK's most convenient and straight-talking food based magazine. Every issue is packed with easy and fun recipes that everyone can enjoy. There will be useful features on quick and easy everyday suppers, meals to enjoy at the weekend as well as speedy menus for stress free entertaining. There will also be interesting articles on the best snacks, baking recipes and taste tests.

BBC Easy Cook - UK December 2013
Book Language: English 
Pages: 84
